INSERT INTO `curso` VALUES (1,1,NULL,NULL,'2022-08-26 23:06:49','Com duração de cinco anos, forma o profissional para atuar na área, realizando, entre outras atividades: análise, planejamento e desenvolvimento de sistemas computacionais centralizados e distribuídos, sistemas embarcados, desenvolvimento e uso de tecnologias de comunicação, sistemas multimídia e hipermídia, redes de computadores, bem como gestão de sistemas industriais e comerciais e de empresas de computação.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5e1f6be47c1bd13d86e1ce59/Licenciatura_em_Letras.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/matematica/PPC_CURSO%20DE%20LICENCIATURA%20EM%20%20LETRAS,%20MATEMÁTICA%20E%20PEDAGOGIA%20-%202020.pdf','Licenciatura em Letras','LL',1),(2,1,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional para atuar em instituições educativas, na Educação Infantil, nos anos iniciais do Ensino Fundamental, nas disciplinas pedagó- gicas de cursos de formação em nível médio e na Educação Especial e na gestão pedagógica e educacional. Além disso, também qualifica o profissional para a atuar em instituições não-escolares e não formais.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5e1f6b877c1bd1571deb64cf/Pedagogia.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/matematica/PPC_CURSO%20DE%20LICENCIATURA%20EM%20%20LETRAS,%20MATEMÁTICA%20E%20PEDAGOGIA%20-%202020.pdf','Licenciatura em Pedagogia','LP',1),(3,1,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional para ministrar aulas nas séries finais do ensino fundamental, no ensino médio e nos cursos técnicos deste nível de ensino, produzir objetos de aprendizagem com conteúdo matemático e atuar em editoras de livros didáticos, entre outras atividades.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5e1f6c157c1bd1571deb64d4/Licenciatura_em_Matem_tica.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/matematica/PPC_CURSO%20DE%20LICENCIATURA%20EM%20%20LETRAS,%20MATEMÁTICA%20E%20PEDAGOGIA%20-%202020.pdf','Licenciatura em Matemática','LM',1),(4,_binary '\0',NULL,NULL,'2022-08-26 23:06:49','Formação de profissional capaz de atuar em um mundo em profundas e aceleradas mudanças econômicas, sociais e culturais e com sólida instrução técnico-prática e metodológica, fundamentada nos conhecimentos técnicos da Física, no entendimento pedagógico e na vivência de experiências relativas ao ensino, qualidades imprescindíveis a um educador.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5953f82c69226e48bd34ec6d/Licenciatura_em_F_sicaFINAL.pdf',NULL,'Licenciatura em Física','LF',1),(5,_binary '\0',NULL,NULL,'2022-08-26 23:06:49','Formação de profissional capaz de atuar em um mundo em profundas e aceleradas mudanças econômicas, sociais e culturais e com sólida instrução técnico-prática e metodológica, fundamentada nos conhecimentos técnicos da Química, no entendimento pedagógico e na vivência de experiências relativas ao ensino, qualidades imprescindíveis a um educador.','Com duração de quatro anos, o curso prepara o cientista para trabalhar ferramentas matemáticas, estatísticas e computacionais voltadas a auxiliar no processo de extração de conhecimentos a partir de dados, que auxiliam nas tomadas de decisões.  ',NULL,'Licenciatura em Química','LQ',1),(6,_binary '\0',NULL,NULL,'2022-08-26 23:06:49','Formação de profissional capaz de atuar em um mundo em profundas e aceleradas mudanças econômicas, sociais e culturais e com sólida instrução técnico-prática e metodológica, fundamentada nos conhecimentos técnicos da Biologia, no entendimento pedagógico e na vivência de experiências relativas ao ensino, qualidades imprescindíveis a um educador.','Formação de profissional capaz de atuar em um mundo em profundas e aceleradas mudanças econômicas, sociais e culturais e com sólida instrução técnico-prática e metodológica, fundamentada nos conhecimentos técnicos da Biologia, no entendimento pedagógico e na vivência de experiências relativas ao ensino, qualidades imprescindíveis a um educador.',NULL,'Licenciatura em Biologia','LB',1),(7,1,NULL,NULL,'2022-08-26 23:06:49','Com duração de cinco anos, forma o profissional para atuar na área, realizando, entre outras atividades: análise, planejamento e desenvolvimento de sistemas computacionais centralizados e distribuídos, sistemas embarcados, desenvolvimento e uso de tecnologias de comunicação, sistemas multimídia e hipermídia, redes de computadores, bem como gestão de sistemas industriais e comerciais e de empresas de computação.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5db214307c1bd15cf783c6c9/EC.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/engenharia-da-computacao/PPC-BTI.pdf','Engenharia de Computação','EC',2),(8,1,NULL,NULL,'2022-08-26 23:06:49','Com duração de três anos, o curso prepara o estudante para o desenvolvimento de soluções que envolvem software, web, nuvem e mobile.','https://univesp.br/sites/58f6506869226e9479d38201/assets/5db215497c1bd15c6efb0394/BTI.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/engenharia-da-computacao/PPC-BTI.pdf','Bacharelado Tecnologia da Informação','BTI',2),(9,1,NULL,NULL,'2022-08-26 23:06:49','Com duração de quatro anos, o curso prepara o cientista para trabalhar ferramentas matemáticas, estatísticas e computacionais voltadas a auxiliar no processo de extração de conhecimentos a partir de dados, que auxiliam nas tomadas de decisões.  ','https://univesp.br/sites/58f6506869226e9479d38201/assets/5db214c77c1bd15cf783c6ce/Ci_ncia_de_Dados.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/engenharia-da-computacao/PPC-BTI.pdf','Bacharelado em Ciência de Dados','BCD',2),(10,1,NULL,NULL,'2022-08-26 23:06:49','Forma profissionais qualificados para gerir organizações, conduzir equipes e gerar inovações. Tem como funções fundamentais planejar, dirigir, organizar e controlar. A formação do Administrador transita pelo ecletismo dos conhecimentos, pela multiplicidade de áreas que auxiliam na construção da formação desse profissional.  ','https://univesp.br/sites/58f6506869226e9479d38201/assets/62268faf7c1bd15db29945fb/Adm.pdf',NULL,'Bacharelado em Administração','BA',3),(11,1,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional para o desenvolvimento de soluções que busquem otimizar os recursos de uma organização, propondo melhorias e promovendo uma mudança organizacional planejada. Sua atuação inclui planejar, projetar, gerenciar e promover os processos organizacionais e os sistemas da organização, sejam elas','https://univesp.br/sites/58f6506869226e9479d38201/assets/621406d97c1bd15f67e72b69/Tecn_logo_em_Processos_Gerenciais.pdf',NULL,'Tecnologia em Processos Gerenciais','TPC',3),(12,_binary '\0',NULL,NULL,'2022-08-26 23:06:49','Forma o profissional para planejar, implementar, supervisionar e avaliar projetos e programas de políticas públicas voltados para o desenvolvimento local e regional. Prepara, também, esse profissional para aplicar metodologias inovadoras de gestão, baseadas nos princípios de administração pública, legislação, tecnologias gerenciais, aspectos ambientais e ética profissional e para avaliar e emitir parecer técnico em sua área de formação.','https://apps.univesp.br/manual-do-aluno/assets/matriz/matriz_gp.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/gestao-publica/PPC%20Gestão%20Pública%20Versão%20Final%20%20-%20REVISADO.pdf','Tecnologia em Gestão Pública','TGP',3),(13,1,NULL,NULL,'2022-08-26 23:06:49','Forma o profissional capaz de observar os processos organizacionais com visão sistêmica e integrada, de analisar e de propor soluções para questões complexas, reunindo competências que integrem formação tecnológica em Engenharia de Produção, com a formação humanística além da necessária instrumentação numérica, quantitativa e computacional, mas sempre observando o desenvolvimento sustentável das organizações.','https://univesp.br/sites/58f6506869226e9479d38201/assets/621406d97c1bd15f67e72b6a/Bacharel_em_Engenharia_de_Produ__o.pdf','https://apps.univesp.br/manual-do-aluno/assets/PPC/engenharia-de-producao/PPC_Engenharia_Producao%20-%202014-%2016%20-%20REVISADO.pdf','Engenharia de Produção','EP',3);

